// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import { CartProvider } from './context/CartContext';
import UserProfile from './pages/UserProfile';

// Pages
import LandingPage from './pages/LandingPage';
import Login from './pages/Login';
import SignUp from './pages/SignUp';
import Dashboard from './pages/Dashboard';
import RestaurantListing from './pages/RestaurantListing';
import RestaurantDetail from './pages/RestaurantDetail';
import Cart from './components/Cart';
import Checkout from './pages/Checkout';
import OrderConfirmation from './pages/OrderConfirmation';
import NotFound from './pages/NotFound';

import OrderHistory from './pages/OrderHistory';
import OrderTracking from './pages/OrderTracking';


// Delivery Pages
import DeliveryDashboard from './pages/delivery/DeliveryDashboard';
import AvailableOrders from './pages/delivery/AvailableOrders';
import DeliveryOrderPage from './pages/delivery/DeliveryOrderPage';

// Restaurant Pages
import RestaurantDashboard from './pages/restaurant/RestaurantDashboard';
import CreateRestaurant from './pages/restaurant/CreateRestaurant';
import ManageMenu from './pages/restaurant/ManageMenu';
import OrderProcessing from './pages/restaurant/OrderProcessing';
import RestaurantSettings from './pages/restaurant/RestaurantSettings';

// Components
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';
import RestaurantNavbar from './components/RestaurantNavbar';
import Footer from './components/Footer';

// Styles
import './App.css';

function App() {
  return (
    <AuthProvider>
      <CartProvider>
        <Router>
          <div className="app">
            <Routes>
              {/* Public routes */}
              <Route path="/" element={<LandingPage />} />
              <Route path="/login" element={<Login />} />
              <Route path="/signup" element={<SignUp />} />

              {/* Protected Dashboard route for customers */}
              <Route
                path="/dashboard"
                element={
                  <ProtectedRoute requiredRole="CUSTOMER">
                    <Navbar />
                    <Dashboard />
                    <Footer />
                  </ProtectedRoute>
                }
              />

              {/* Restaurant Owner Routes */}
              <Route
                path="/restaurant/dashboard"
                element={
                  <ProtectedRoute requiredRole="RESTAURANT_STAFF">
                    <RestaurantNavbar />
                    <RestaurantDashboard />
                    <Footer />
                  </ProtectedRoute>
                }
              />

<Route
  path="/profile"
  element={
    <ProtectedRoute>
      <Navbar />
      <UserProfile />
      <Footer />
    </ProtectedRoute>
  }
/>

{/* Restaurant-specific profile route */}
<Route
  path="/restaurant/profile"
  element={
    <ProtectedRoute requiredRole="RESTAURANT_STAFF">
      <RestaurantNavbar />
      <UserProfile />
      <Footer />
    </ProtectedRoute>
  }
/>

{/* Delivery-specific profile route */}
<Route
  path="/delivery/profile"
